class Solution:
    # @param board, a 2D array
    # Capture all regions by modifying the input board in-place.
    # Do not return any value.
    def __init__(self):
        self.count = 0

    def solve(self, board):
        if not board:
            return

        queue = set()
        rows = len(board)
        cols = len(board[0])

        for row in range(rows):
            board[row] = (list(board[row]))
